import React, {Component} from 'react';
import axios from 'axios';
class Table extends Component{

    constructor(props) {
        super(props);

        this.state = {
            headers : [],
            players: [],
        }
    }
    componentDidMount(){
        axios
          .get(`http://localhost:9876/allplayers`)
          .then(res => {
                    this.setState({headers: res.data[0]})
                    res.data.pop()
                    this.setState({players: res.data})
                    console.log(this.state.headers)
                    console.log(this.state.players)
                }
            )
          .catch(err => console.error(err));
    }

    render(){
        return(
        <div>
            <table>
                <thead>
                    <tr>
                    {
                    this.state.headers.map(header =>
                        <td>{header}</td>
                        )
                    }
                    </tr>
                </thead>
                <tbody>
                    {
                        this.state.players.map(player =>
                            <tr>
                                <td>{player[0]}</td>
                                <td>{player[1]}</td>
                                <td>{player[2]}</td>
                                <td>{player[3]}</td>
                                <td>{player[4]}</td>
                                <td>{player[5]}</td>
                                <td>{player[6]}</td>
                                <td>{player[7]}</td>
                                <td>{player[8]}</td>
                            </tr>

                        )
                    }

                </tbody>
            </table>
        </div>
        )
    }

} export default Table;
